A StreamWriter object created using the StreamManager can be used to write events into the Pravega Stream. The events that are written will appear in the Stream exactly once. The event of type String is converted into bytes with UTF-8 encoding. The user can optionally specify the routing key. The StreamWriter can also write a byte array into the Pravega Stream with/without a routing key. Note that the implementation provides retry logic to handle connection failures and service host failures. Internal retries will not violate the exactly once semantic so it is better to rely on them than to wrap this with custom retry logic. import pravega_client
manager=pravega_client.StreamManager("127.0.0.1:9090")
// lets assume the Pravega scope and stream are already created.
writer=manager.create_writer("scope", "stream")
// write into Pravega stream without specifying the routing key.
writer.write_event("e1")
// write into Pravega stream by specifying the routing key.
writer.write_event("e2", "key1") e="eventData" // Convert the event object to a byte array.
e_bytes=e.encode("utf-8") // write into Pravega stream without specifying the routing key. writer.write_event_bytes("e1") // write into Pravega stream by specifying the routing key. writer.write_event_bytes("e2", "key1")

