One or more EventReaders can be created from the ReaderGroup object created using the StreamManager. Every reader has an async method call reader.get_segment_slice_async() that returns a Python Future which completes when a segment slice is acquired for consumption. It can contain one or more events and the user can iterate over the segment slice to read the events. If there are multiple segments in the stream then this API can return a segment slice of any segments in the stream. The reader ensures that events returned by the stream are in order. If multiple readers are created under the same reader group then the readers co-ordinate amongst themselves and divide the responsibility of reading from different segments in the Pravega stream. A sample example snippet is shown below. import pravega_client
manager = pravega_client.StreamManager("127.0.0.1:9090")
// lets assume the Pravega scope and stream are already created.
reader_group=manager.create_reader_group("rg1", "scope", "stream")
reader=reader_group.create_reader("reader_id");
slice=await reader.get_segment_slice_async()
for event in slice: print(event.data())
